import React from 'react';

import googleImage from '../../img/google.jpg';

const BoardCard = (): JSX.Element => {
    return (
        <div className="boardcard">
            <img className="boardcard__image" alt="" src={googleImage}></img>
            <div className="boardcard__info">
                <div className="boardcard__title"></div>
                <div className="boardcard__todos-total"></div>
            </div>
        </div>
    );
}

export default BoardCard;
